;; **
;;; ## Covariance
;;; 
;;; **Covariance** is a way to quantify the strength of a relationship between 2 variables. It measures the tendency of 2 variables to change together.
;;; 
;;; $$dx\_i=x\_i-\bar{x}$$
;;; $$dy\_i=y\_i-\bar{y}$$
;;; 
;;; Here @@x\_i@@ is the value of @@X@@ at index @@i@@, the same holds for @@y\_i@@, @@\bar{x}@@ and @@\bar{y}@@ are the means.
;;; 
;;; If we multiply them together the product is positive when they have the same sign and negative when they are different. By adding up the products we get a measure of the tendency of the variables to change together in the same direction.
;;; 
;;; $$cov(X,Y)=\frac{1}{n}\sum\_{i=1}^n dx\_i dy\_i$$
;; **

;; @@
(defn covariance
  [xs ys]
  (let [x-bar (s/mean xs)
        y-bar (s/mean ys)
        dx    (map (fn [x] (- x x-bar)) xs)
        dy    (map (fn [y] (- y y-bar)) ys)]
    (s/mean (map * dx dy))))
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-var'>#&#x27;cljds.ch3.ws/covariance</span>","value":"#'cljds.ch3.ws/covariance"}
;; <=

;; @@
(let [data (swimmer-data)
      heights (i/$ "Height, cm" data)
      weights (i/log (i/$ "Weight" data))]
  (covariance heights weights))
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-double'>1.3543488370216024</span>","value":"1.3543488370216024"}
;; <=

;; **
;;; ## Pearson's Correlation
;;; 
;;; The issue with the result we got from `covariance` is that `1.354` is hard to interpret because it is expressed in units which are the product of the units of the inputs.
;;; 
;;; With **Pearson's correlation** we divide the deviations by the product of the standard deviations. In this way we get a result between `-1` and `1`.
;;; 
;;; $$r=\frac{1}{n}\sum\_{i=1}^n\frac{dx\_i}{\sigma\_x}\frac{dy\_i}{\sigma\_y}$$
;;; 
;;; Since the standard deviations are constant for variables @@X@@ and @@Y@@ the equation can be simplified as:
;;; 
;;; $$r=\frac{cov(X,Y)}{\sigma\_x\sigma\_y}$$
;; **

;; @@
(defn correlation
  [x y]
  (/ (covariance x y)
     (* (s/sd x)
        (s/sd y))))
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-var'>#&#x27;cljds.ch3.ws/correlation</span>","value":"#'cljds.ch3.ws/correlation"}
;; <=

;; @@
(let [data (swimmer-data)
      h (i/$ "Height, cm" data)
      w (i/log (i/$ "Weight" data))]
  (correlation h w))
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-double'>0.8664726179931042</span>","value":"0.8664726179931042"}
;; <=

;; **
;;; ## Hypothesis testing
;; **

;; @@
(defn t-statistic
  [x y]
  (let [r (correlation x y)
        r-square (* r r)
        df (- (count x) 2)]
    (/ (* r df)
       (i/sqrt (- 1 r-square)))))
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-var'>#&#x27;cljds.ch3.ws/t-statistic</span>","value":"#'cljds.ch3.ws/t-statistic"}
;; <=

;; @@
(let [data (swimmer-data)
      heights (i/$ "Height, cm" data)
      weights (i/log (i/$ "Weight" data))
      t-value (t-statistic heights weights)
      df (- (count heights) 2)
      p (* 2 (s/cdf-t t-value
                      :df df
                      :lower-tail? false))]
  (println "t-value" t-value)
  (println "p value" p))
