;; @@
(defn critical-value
  [confidence ntails]
  (let [lookup (- 1 (/ (- 1 confidence) ntails))]
    (s/quantile-normal lookup)))
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-var'>#&#x27;cljds.ch3.ws/critical-value</span>","value":"#'cljds.ch3.ws/critical-value"}
;; <=

;; @@
(critical-value 0.95 2)
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-double'>1.959963984540054</span>","value":"1.959963984540054"}
;; <=

;; @@
(defn z->r
  [z]
  (/ (- (i/exp (* 2 z)) 1)
     (+ (i/exp (* 2 z)) 1)))

(defn r-confidence-interval
  [crit x y]
  (let [r  (correlation x y)
        n  (count x)
        zr (* 0.5 (i/log (/ (+ 1 r)
                           (- 1 r))))
        sez (/ 1 (i/sqrt (- n 3)))]
    [(z->r (- zr (* crit sez)))
     (z->r (+ zr (* crit sez)))]))
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-var'>#&#x27;cljds.ch3.ws/r-confidence-interval</span>","value":"#'cljds.ch3.ws/r-confidence-interval"}
;; <=

;; @@
(let [data (swimmer-data)
      heights (i/$ "Height, cm" data)
      weights (i/log (i/$ "Weight" data))
      interval (r-confidence-interval 1.96 
                                      heights 
                                      weights)]
  (println "Confidence interval: " interval))
