(defn slope
  [x y]
  (/ (covariance x y)
     (s/variance x)))

(defn intercept
  [x y]
  (- (s/mean y)
     (* (s/mean x)
        (slope x y))))
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-var'>#&#x27;cljds.ch3.ws/intercept</span>","value":"#'cljds.ch3.ws/intercept"}
;; <=

;; @@
(let [data (swimmer-data)
      h (i/$ "Height, cm" data)
      w (i/log (i/$ "Weight" data))
      a (intercept h w)
      b (slope h w)]
  (println "Intercept: " a)
  (println "Slope: " b))
