;; @@
(defn residuals
  [a b x y]
  (let [estimate (regression-line a b)
        residual (fn [x y]
                   (- y (estimate x)))]
    (map residual x y)))
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-var'>#&#x27;cljds.ch3.ws/residuals</span>","value":"#'cljds.ch3.ws/residuals"}
