      h (->> (i/$ "Height, cm" data)
             (map (jitter 0.5)))
      w (i/log (i/$ "Weight" data))
      a (intercept h w)
      b (slope h w)]
  (-> (c/scatter-plot h (residuals a b h w))
      (c/add-function (constantly 0) 150 210)
      (chart-view)))
