(defn add-bias
  [x]
  (i/bind-columns (repeat (i/nrow x) 1) x))
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-var'>#&#x27;cljds.ch3.ws/add-bias</span>","value":"#'cljds.ch3.ws/add-bias"}
