;; **
;;; ### Normal equation
;;; 
;;; $$\Beta=(X^TX)^{-1}X^Ty$$
;; **

;; @@
(defn normal-equation
  [x y]
  (let [xtx (i/mmult (i/trans x) x)
        xtxi (i/solve xtx)
        xty (i/mmult (i/trans x) y)]
    (i/mmult xtxi xty)))
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-var'>#&#x27;cljds.ch3.ws/normal-equation</span>","value":"#'cljds.ch3.ws/normal-equation"}
;; <=

;; @@
(let [data (swimmer-data)
      x (i/matrix (i/$ "Height, cm" data))
      y (i/matrix (i/log (i/$ "Weight" data)))]
  (normal-equation (add-bias x) y))
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-unkown'> A 2x1 matrix\n -------------\n 1.69e+00 \n 1.43e-02 \n</span>","value":" A 2x1 matrix\n -------------\n 1.69e+00 \n 1.43e-02 \n"}
;; <=

