;; **
;;; The previous matrix shows the **intercept** and the **slopes** for height and age, respectively.
;;; 
;;; ## Multiple R-squared
;; **

;; @@
(defn r-squared
  [coefs x y]
  (let [fitted      (i/mmult x coefs)
        residuals   (i/minus y fitted)
        differences (i/minus y (s/mean y))
        rss         (i/sum-of-squares residuals)
        ess         (i/sum-of-squares differences)]
    (- 1 (/ rss ess))))
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-var'>#&#x27;cljds.ch3.ws/r-squared</span>","value":"#'cljds.ch3.ws/r-squared"}
;; <=

;; @@
(let [data (swimmer-data)
      x (->> data
             (feature-matrix ["Height, cm" "Age"])
             (add-bias))
      y (->> (i/$ "Weight" data)
             (i/log)
             (i/matrix))
      beta (normal-equation x y)]
  (r-squared beta x y))
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-double'>0.7568466547934676</span>","value":"0.7568466547934676"}
;; <=

;; **
;;; ## Adjusted R-squared
;; **

;; @@
(defn adj-r-squared
  [coefs x y]
  (let [r-squared (r-squared coefs x y)
        n         (count y)
        p         (count coefs)]
    (- 1
       (* (- 1 r-squared)
          (/ (dec n)
             (dec (- n p)))))))
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-var'>#&#x27;cljds.ch3.ws/adj-r-squared</span>","value":"#'cljds.ch3.ws/adj-r-squared"}
;; <=

;; @@
(let [data (swimmer-data)
      x (->> data
             (feature-matrix ["Height, cm" "Age"])
             (add-bias))
      y (->> (i/$ "Weight" data)
             (i/log)
             (i/matrix))
      beta (normal-equation x y)]
  (adj-r-squared beta x y))
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-double'>0.7559934851611638</span>","value":"0.7559934851611638"}
;; <=

;; **
;;; ## F-test
;; **

;; @@
(defn f-test
  [coefs x y]
  (let [fitted     (i/mmult x coefs)
        difference (i/minus fitted (s/mean y))
        residuals  (i/minus y fitted)
        ess        (i/sum-of-squares difference)
        rss        (i/sum-of-squares residuals)
        p 		   (i/ncol x)
        n 		   (i/nrow y)
        df1 	   (- p 1)
        df2 	   (- n p)
        msm 	   (/ ess df1)
        mse 	   (/ rss df2)
        f-stat 	   (/ msm mse)]
    (s/cdf-f f-stat :df1 df1 :df2 df2 :lower-tail? false)))
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-var'>#&#x27;cljds.ch3.ws/f-test</span>","value":"#'cljds.ch3.ws/f-test"}
;; <=

;; @@
(let [data (swimmer-data)
      x (->> data
             (feature-matrix ["Height, cm" "Age"])
             (add-bias))
      y (->> (i/$ "Weight" data)
             (i/log)
             (i/matrix))
      beta (:coefs (s/linear-model y x :intercept false))]
  (f-test beta x y))
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-double'>1.1102230246251565E-16</span>","value":"1.1102230246251565E-16"}
;; <=

