;; @@
(defn dummy-mf
  [sex]
  (if (= sex "F")
    0.0 1.0))
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-var'>#&#x27;cljds.ch3.ws/dummy-mf</span>","value":"#'cljds.ch3.ws/dummy-mf"}
;; <=

;; @@
(let [data (->> (swimmer-data)
                (i/add-derived-column "Dummy MF"
                                      ["Sex"]
                                      dummy-mf))
      x (->> data
             (feature-matrix ["Height, cm"
                              "Age"
                              "Dummy MF"])
             (add-bias))
      y (->> (i/$ "Weight" data)
             (i/log)
             (i/matrix))
      beta (normal-equation x y)]
  (adj-r-squared beta x y))
