;; **
;;; ## Relative power
;;; 
;;; Calculate feature importance
;; **

;; @@
(defn beta-weight
  [coefs x y]
  (let [sdx (map s/sd (i/trans x))
        sdy (s/sd y)]
    (map #(/ (* %1 %2) sdy) sdx coefs)))
