;; =>
;;; {"type":"html","content":"<span class='clj-var'>#&#x27;cljds.ch3.ws/beta-weight</span>","value":"#'cljds.ch3.ws/beta-weight"}
;; <=

;; @@
(let [data (->> (swimmer-data)
                (i/add-derived-column "Dummy MF"
                                      ["Sex"]
                                      dummy-mf))
      x (->> data
             (feature-matrix ["Height, cm"
                              "Age"
                              "Dummy MF"])
             (add-bias))
      y (->> (i/$ "Weight" data)
             (i/log)
             (i/matrix))
      beta (normal-equation x y)]
  (beta-weight beta x y))
